import {
  SObject,
  SObjectField,
  SObjectFieldType,
  SFDCListView,
  SObjectType,
  SalesforceSummary,
  SObjectSchema,
} from '@src/types/salesforce';
import { applySalesforceSummaryDefaults } from '@src/lib/models/salesforce';

export const createSObject = (partial?: Partial<SObject>): SObject => {
  return {
    url: 'http://www.salesforce.com',
    href: 'http://www.salesforce.com',
    resource: 'resource',
    updatable: true,
    deletable: true,
    custom: false,
    fields: [createSObjectField()],
    ...partial,
  };
};

export const createSObjectSchema = (partial?: Partial<SObjectSchema>): SObjectSchema => {
  return {
    fields: [createSObjectField()],
    ...partial,
  };
};

export const createSObjectField = (partial?: Partial<SObjectField>): SObjectField => {
  return {
    type: SObjectFieldType.String,
    updatable: true,
    custom: true,
    name: 'email',
    displayName: 'Email',
    value: 'doge@polymail.io',
    displayValue: 'doge@polymail.io',
    required: false,
    creatable: false,
    ...partial,
  };
};

export const createSFDCListView = (partial?: Partial<SFDCListView>): SFDCListView => {
  return {
    id: 'id',
    name: 'salesforce list',
    sobjectType: SObjectType.Lead,

    ...partial,
  };
};

export function createSalesforceSummary(partial?: Partial<SalesforceSummary>): SalesforceSummary {
  return applySalesforceSummaryDefaults({
    contact: createSObject(),
    tasks: [createSObject(), createSObject()],
    activityHistory: [createSObject(), createSObject()],
    opportunities: [createSalesforceOpportunity()],
    openTasksCount: 5,
    activityHistoryCount: 10,
    ...partial,
  });
}

export function createSalesforceSchema(partial?: Partial<SObjectSchema>): SObjectSchema {
  return {
    fields: [createSObjectField()],
    ...partial,
  };
}

